from math import prod
from itertools import product
def auptod(maxdigits):
    alst = []
    for d in range(1, maxdigits+1):
        maxr, argmaxr = 0, []
        for p in product("123456789", repeat=d):
            t = int("".join(p))
            r = t%prod(map(int, p))
            if r == maxr:
                argmaxr.append(t)
            elif r > maxr:
                maxr = r
                argmaxr = [t]
        alst.extend(argmaxr)
    return alst
